#include "DirectedMotifResults.h"

DirectedMotifResults::DirectedMotifResults(void)
{
	_NodeCount = 0;
	_NodeResults = NULL;
}
DirectedMotifResults::DirectedMotifResults(unsigned int NodeCount ) 
{ 
	_NodeCount = NodeCount; 
	_NodeResults = new unsigned int[NodeCount * MOTIF_ROLE_COUNT];
	memset(_NodeResults, 0, sizeof(unsigned int) * NodeCount * MOTIF_ROLE_COUNT);
}
	
DirectedMotifResults::~DirectedMotifResults(void)
{
	if (_NodeResults != NULL) 
		delete [] _NodeResults;
}

